INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 24001, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 401, "アヤネ", 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 24002, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 402, "アヤネ", 2.21, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 24003, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 403, "アヤネ", 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 24004, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 701, "アサヒ", 1.99, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 24005, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 702, "アサヒ", 2.21, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 24006, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 703, "アサヒ", 3.33, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 24007, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 801, "部員３", 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 24008, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 802, "部員３", 2.68, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 24009, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 803, "部員３", 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 24010, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 501, "", 0.0, "やった！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 24011, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 502, "", 0.0, "勝ったよ！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 24012, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 503, "", 0.0, "いい調子！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 24013, 6, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 111, "ミサト", 5.33, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 24014, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 112, "ミサト", 6.85, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 24015, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 113, "ミサト", 3.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192401, 24016, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 611, "ダイチ", 6.11, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192401, 24017, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 612, "ダイチ", 6.75, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192401, 24018, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 613, "ダイチ", 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113401, 24019, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 211, "ハツネ", 4.52, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113401, 24020, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 212, "ハツネ", 3.89, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113401, 24021, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 213, "ハツネ", 13.49, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (106501, 24022, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 311, "カヤ", 3.17, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (106501, 24023, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 312, "カヤ", 4.42, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (106501, 24024, 6, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 313, "カヤ", 2.89, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 24025, 4, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 3, 421, "アヤネ", 3.71, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 24026, 2, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 721, "アサヒ", 5.1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 24027, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 3, 821, "部員３", 4.34, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 24028, 1, 0.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 521, "", 0.0, "いい勝負だったよ\nまたやろうね", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 24029, 1, -360.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 101, "ミサト", 5.62, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 24030, 1, -360.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 102, "ミサト", 9.58, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 24031, 2, -360.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 103, "ミサト", 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 24032, 2, -360.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1, 104, "ミサト", 9.13, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 10046, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 24033, 1, -360.0, 24, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2, 105, "ミサト", 8.27, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 10046, 0.0);
